import React from "react";
import images1 from "../img/images1.jpg";
import images2 from "../img/images2.webp";
import images3 from "../img/images3.jpeg";

const Testimotial = () => {
  return (
    <>
    <div>
      <img src={images1} alt="images1" />
    </div>
    </>
  );
};

export default Testimotial;
